import React, {useState, useEffect} from 'react'

function Diagnose(){

    const [data, setData] = useState(0);

    useEffect(() => {
        fetch("/symptoms/").then(
            res => res.json()
        ).then(
            data =>{
                setData(data.symptoms)
                console.log(data)
            }
        );
    }, [])

    return (
        <div>
            <h1>Diagnosis results</h1>
            {data.symptoms}
            {/* {(typeof {data} === 'undefined') ? (
                <p>Loading...</p>
            ) : (
                {data}
            )

            } */}
        </div>
    );
}

export default Diagnose;
